var gameId = "#intro",
    preId = "#intro";
$(function () {
    $(".btn-game").click(function (a) {
        a = $(this);
        a.hasClass("false") ? goFasle() : (preId = gameId, gameId = $(this).attr("href"), a.hasClass("true") ? goTrue() : showNext(gameId));
        event.preventDefault()
    })
});

function initIndex() {
    setKv();
    setSence();
    goKv()
}

function showNext(a) {
    switch (a) {
        case "#q1":
            outIntro();
            setQ1();
            goQ1();
            break;
        case "#q2":
            outQ1();
            setQ2();
            goQ2();
            break;
        case "#q3":
            outQ2();
            setQ3();
            goQ3();
            break;
        case "#q4":
            outQ3();
            setQ4();
            goQ4();
            break;
        case "#q5":
            outQ4();
            setQ5();
            goQ5();
            break;
        case "#q6":
            outQ5();
            setQ6();
            goQ6();
            break;
        case "#q7":
            outQ6();
            setQ7();
            goQ7();
            break;
        case "#q8":
            outQ7();
            setQ8();
            goQ8();
            break;
        case "#q9":
            outQ8();
            setQ9();
            goQ9();
            break;
        case "#finish":
            outQ9();
            setFinish();
            goFinish();
            break;
        case "#present":
            _customCallback = function (b) {
                outFinish();
                setPresent(b);
                goPresent()
            }, grecaptcha.execute(_customCallback)
    }
}
var $hintTure = $("#hint-true"),
    $hintFasle = $("#hint-false");

function goFasle() {
    $hintFasle.css("pointer-events", "auto");
    var a = $(gameId + " .frame");
    (new TimelineMax({
        repeat: 0,
        delay: 0,
        repeatDelay: 0
    })).to($(a), .1, {
        rotationZ: 2
    }).to($(a), .1, {
        rotationZ: -2
    }).to($(a), .1, {
        rotationZ: 2
    }).to($(a), .1, {
        rotationZ: -2
    }).to($(a), .1, {
        rotationZ: 2
    }).to($(a), .1, {
        rotationZ: -2
    }).to($(a), .1, {
        rotationZ: 0
    });
    TweenMax.to($hintFasle, .5, {
        alpha: 1,
        yoyo: !0,
        repeat: 1,
        repeatDelay: .5,
        delay: 0,
        ease: Power2.easeOut,
        onComplete: function () {
            $hintFasle.css("pointer-events", "none")
        }
    })
}

function goTrue() {
    $hintTure.css("pointer-events", "auto");
    TweenMax.to($hintTure, .5, {
        alpha: 1,
        yoyo: !0,
        repeat: 1,
        repeatDelay: .5,
        delay: 0,
        ease: Power2.easeOut,
        onComplete: function () {
            $hintTure.css("pointer-events", "none");
            showNext(gameId)
        }
    })
}
var $doorL = $(".door-l"),
    $doorR = $(".door-r"),
    $light1 = $(".light-1"),
    $light2 = $(".light-2"),
    $light3 = $(".light-3"),
    $storeTxet = $(".store-text"),
    $arrowDown = $(".arrow-down");

function setKv() {
    TweenMax.set($light1, {
        alpha: 0
    });
    TweenMax.set($light2, {
        alpha: 0
    });
    TweenMax.set($light3, {
        alpha: 0
    })
}

function goKv() {
    (new TimelineMax({
        repeat: -1,
        delay: 1,
        repeatDelay: 2
    })).to($doorL, 1, {
        x: "-100%"
    }).to($doorR, 1, {
        x: "100%"
    }, "-=1").to($doorL, 1, {
        x: "-0%"
    }, "+=7").to($doorR, 1, {
        x: "0%"
    }, "-=1");
    (new TimelineMax({
        repeat: -1,
        delay: 0,
        repeatDelay: 0,
        ease: Power4.easeIn
    })).to($light3, .5, {
        alpha: 0
    }).to($light1, .5, {
        alpha: 1
    }, "-=0.5").to($light2, .5, {
        alpha: 1
    }).to($light1, .5, {
        alpha: 0
    }, "-=0.5").to($light3, .5, {
        alpha: 1
    }).to($light2, .5, {
        alpha: 0
    }, "-=0.5").to($storeTxet, .5, {
        alpha: 0
    }).to($storeTxet, .5, {
        alpha: 1
    }).to($storeTxet, .5, {
        alpha: 0
    }).to($storeTxet,
        .5, {
            alpha: 1
        });
    TweenMax.to($arrowDown, .5, {
        y: "15%",
        yoyo: !0,
        repeat: -1,
        delay: 0,
        ease: Power2.easeOut
    })
}
