function setPresent(a) {
    getSN(a)
}

function goPresent() {
    TweenMax.to($present, .5, {
        y: "0%",
        alpha: 1,
        repeat: 0,
        delay: .2,
        ease: Power2.easeOut,
        onComplete: function () {
            $finish.css("position", "relative")
        }
    })
}

function getSN(a) {
    $.ajax({
        method: "POST",
        url: api_url + "api/eventdo.php",
        dataType: "json",
        async: !1,
        data: {
            action: "get_sn",
            "g-recaptcha-response": a
        }
    }).done(function (b) {
        b.result ? $("#sn-code").html(b.sn) : ($("#title-present").html("\u5e8f\u865f\u5df2\u65bc" + b.last_sent_at), $("#sn-code").html("\u5168\u6578\u9818\u53d6\u5b8c\u7562"))
    }).fail(function (b) {})
};